import { isCursorAtEnd } from "@testing-library/user-event/dist/utils";

let curDate = new Date(2020,5,5,2);
curDate = curDate.getHours();

let greet = '';
const greetStyle = {};


//  applying the date Logic with Greeting 
if(curDate >= 0 && curDate <=12){
  greet = "Good Morning";
  greetStyle.color = "green";
}
else if(curDate > 12 && curDate<= 16){
  greet = "Good Afternoon";
  greetStyle.color = "orange"
}
else if(curDate >16 && curDate<=24){
  greet = "Good Evening";
}
else{
  greet = "Good Night";
}

// declaring and exporting the function 
function Hellow(){
  return <h1>Hellow Sir ,{greet} </h1>
}

export default Hellow;
